      alt: "Portret de grup Ã®n grÄƒdiniÈ›Äƒ",
      category: "EchipÄƒ È™i comunitate"
    },
    {
      src: "/galerie/learning-conception-new-words-children-in-kinder-2025-08-10-10-08-27-utc-min.JPG",
      alt: "Copiii Ã®nvaÈ›Äƒ cuvinte noi",
      category: "Proces educativ"
    },
    {
      src: "/galerie/mother-sitting-with-two-children-having-discussio-2025-04-04-17-34-34-utc-min.jpg",
      alt: "PÄƒrinÈ›i È™i copii Ã®n discuÈ›ie",
      category: "Comunicare cu pÄƒrinÈ›ii"
    },
    {
      src: "/galerie/chemical-experiment-on-kids-birthday-party-2024-09-16-16-13-21-utc-min.jpg",
      alt: "Experimente È™tiinÈ›ifice la petrecerea de ziua copilului",
      category: "Evenimente speciale"
    },
    {
      src: "/galerie/people-2024-10-18-05-12-36-utc-min.jpg",
      alt: "Echipa Ringabell cu copiii",
      category: "Echipa È™i atmosferÄƒ"
    }
  ];


  return (
    <div className="gallery">
      {/* Hero Section */}
      <section
        className="hero parallax-section"
        data-reveal="up"
        data-reveal-once="true"
      >
        <div className="floating-elements">
          <img src="/childrenpart/capsuna.png" alt="CÄƒpÈ™unÄƒ" className="floating-element" style={{width: '80px', height: '80px'}} />
          <img src="/childrenpart/lubenita.png" alt="LubeniÈ›Äƒ" className="floating-element" style={{width: '75px', height: '75px'}} />
          <img src="/childrenpart/floare albastra.png" alt="Floare albastrÄƒ" className="floating-element" style={{width: '65px', height: '65px'}} />
          <img src="/childrenpart/fluture.png" alt="Fluture" className="floating-element" style={{width: '60px', height: '60px'}} />
          <img src="/childrenpart/floare roz.png" alt="Floare roz" className="floating-element" style={{width: '70px', height: '70px'}} />
          <img src="/childrenpart/buburuza .png" alt="BuburuzÄƒ" className="floating-element" style={{width: '50px', height: '50px'}} />
          <img src="/childrenpart/albina.png" alt="Albina" className="floating-element" style={{width: '45px', height: '45px'}} />
          <img src="/childrenpart/balena.png" alt="BalenÄƒ" className="floating-element" style={{width: '90px', height: '90px'}} />
          <img src="/childrenpart/peste.png" alt="PeÈ™te" className="floating-element" style={{width: '55px', height: '55px'}} />
        </div>
        <div className="hero-content bounce-in">
          <h1 className="hero-title">Galeria noastrÄƒ</h1>
          <p className="hero-subtitle">
            Momentele frumoase È™i zÃ¢mbetele copiilor Ã®n activitÄƒÈ›ile lor favorite
          </p>
        </div>
      </section>

      {/* Gallery Introduction */}
      <section
        className="section"
        data-reveal="up"
        data-reveal-once="true"
      >
        <div className="container">
          <h2 className="section-title">Momente de neuitat</h2>
          <div style={{textAlign: 'center', maxWidth: '800px', margin: '0 auto'}}>
            <p style={{fontSize: '1.2rem', color: 'var(--gray-600)'}}>
              ÃŽn galeria Ringabell poÈ›i vedea cÃ¢t de fericiÈ›i È™i implicaÈ›i sunt copiii Ã®n 
              activitÄƒÈ›ile noastre. Fiecare imagine spune o poveste despre bucuria Ã®nvÄƒÈ›Äƒrii, 
              prieteniile care se formeazÄƒ È™i momentele magice ale copilÄƒriei.
            </p>
          </div>
        </div>
      </section>

      {/* Main Gallery */}
      <section
        className="section"
        style={{background: 'var(--gray-100)', padding: '4rem 0'}}
        data-reveal="up"
        data-reveal-once="true"
      >
